import React from 'react';
import './Preloader.css'
// import Aos from 'aos';

const Preloader = () => {

    

  return (
    <>
        <div className='preloaderComtainer' data-aos="fade-down">
            <h1 data-aos="fade-down" data-aos-delay="1000">Ooo   Mama   Khadja</h1>
        </div>
    </>
  );
}

export default Preloader;
